import background from './img/background.png'

const Activité = () => {
    return (  
        <div style={{
            backgroundImage: "url(" + background + ")",
            backgroundPosition: "left",
            backgroundSize: "cover",
            backgroundRepeat: "no-repeat",
            width: "100vw",
            height: "100vh",
          }}>


            <h2>Activite a venir</h2>
        </div>


    );
}

export default Activité ;
